Say hello to the Team Lew's Signature Series. Designed by 5 of the most credible bass tournament fishermen in the world, these series of technique-specific rods will cater to any angling style and preference.

@roseoutdoors'  Signature Series was built with versatility in mind. Of the techniques Mark excels at, his series has a rod for it. This offshore angling master has developed a Swimbait, Jig/Worm, Deep Crankbait, Carolina Rig rod coming soon to lews.com.

